import React from "react";
import Home from "./pages/Home";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Layout from "./layout/home/Layout";
import ProductsNavbar from "./layout/products/ProductsNavbar";
import Products from "./pages/Products";
import Marvel from "./layout/products/Marvel";
import Kid from "./layout/products/Kid";
import Expensive from "./layout/products/Expensive";
import About from "./componants/InfoRows/InfoRow";
import {
  homeAboutUsRowData,
  homeOurJourneyRowData,
} from "../data/HomePageData";

import Contact from "./pages/Contact";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Layout />}>
          <Route index element={<Home />} />
          <Route path="/products" element={<ProductsNavbar />}>
            <Route index element={<Products />} />
            <Route path="Marvel" element={<Marvel />} />
            <Route path="Expensive" element={<Expensive />} />
            <Route path="Kid" element={<Kid />} />
          </Route>
          <Route
            path="/About"
            element={
              <About
                src={homeAboutUsRowData.src}
                title={homeAboutUsRowData.title}
                desc={homeAboutUsRowData.desc}
              />
            }
          />
          <Route path="/contact" element={<Contact />} />
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
